        public static List<GlossaryTermScript> getTermsFromTSV1(string tsvContent)//, int startRow, int endRow)
        {
            var terms = new List<GlossaryTermScript>();
            int j = 0;
            using (StringReader stringReader = new StringReader(tsvContent))
            {
                using (TextFieldParser parser = new TextFieldParser(stringReader))
                {
                    parser.TextFieldType = FieldType.Delimited;
                    parser.SetDelimiters("\t");
                    while (!parser.EndOfData)
                    {
                        //Process row
                        j++; //row number
                        int i = 1; // column number
                        string[] fields = parser.ReadFields();
                            var term = new GlossaryTermScript();
                            foreach (string s in fields)
                            {
                                if (i == 1) term.Level = s;
                                if (i == 2) term.sLang = s;
                                if (i == 3) term.tLang = s;
                                i++;
                            }
                            terms.Add(term);
                    }
                }
            }
            return terms;
        }
